// vendor

let messages = [input_channel_params, main_output_bus_params, misc_params];

function findControl(value, eventType, bank, options){
	return findKey(options, function(o) {
		return findIndex(eventType, o.type) != -1 && isEqual(o[bank], value);
	});
}

function findIndex(value, array){
	return lodash_indexof(array, value);
}

function findBank(banks, channel, options){
	return banks[lodash_indexof(options['midi-channels'], channel + 1)];
}

function getControlType(control){
	let controlType = '', controlSplit = '';
 // raw, raw-control, control, input, main, misc, preset
	if(Array.isArray(control)){ // raw
		controlType = 'raw';
	} else {
		controlSplit = control.split(':');
		if(control === 'control'){ // raw-control
			controlType = 'raw-control';
		} else if(controlSplit[0] === 'control'){ // control
			controlType = 'control';
		} else if(control === 'expander'){ // raw-expander
			controlType = 'raw-expander';
		} else if(controlSplit[0] === 'expander'){ // expander
			controlType = 'expander';
		} else if(!isNaN(controlSplit[1])){ // input
			controlType = 'input';
		} else { // main, misc, preset
			controlType = controlSplit[0];
		}
	}

	return controlType
}

function controlMessage(control, value, messageType = 'input'){
	let messageTypes = ['input', 'main', 'misc', 'preset'],
			channelTypes = [1, 9, 10, 1],
			controlSplit = control.split(':'),
			controlName,
			inputChannel,
			type, cc;

			if(messageType === 'input'){
				controlName = controlSplit[0];
				inputChannel = +controlSplit[1];
			} else {
				controlName = controlSplit[1];
			}

			if(control === 'preset'.toLowerCase()){
				type = 192;
				cc = null;
				messageType = 'preset';
			} else {
				type = 176;
				cc = messages[messageTypes.indexOf(messageType)][controlName];
			}

			let channel = (messageType === 'input') ? inputChannel : channelTypes[messageTypes.indexOf(messageType)];

	type = type + channel - 1;

	let message = [type, cc, value];

	return lodash_without(message, undefined, null);
}

// debug
let kmixLog = document.querySelector('#kmixlog');

function midiMessageHandler(event, device){
	let data = event.data,
			type = data[0] & 0xf0,
			channel = data[0] & 0xf,
			control = data[1],
			bank = findBank(device.banks, channel, device.options),
			port = '',
			controlName = '',
			kind = '';

	port = event.target.name;

	// find control; 'fader-1'
	controlName = findControl(control, type, bank, device.options);
	// emit ':off' if 128
	if(type === 128) kind = ':off';
	// send out event for controlName
	device.emit(controlName + kind, payload(data));
	// if listening for any event
	if(device.listeners('any', true)){
		device.emit('any', anyPayload(controlName + kind, data));
	}

	// debug to console
	if(device._debug){
		let debugLog = {
			'control:' : controlName,
			'port:'  : port,
			'portID:'    : event.target.id,
			'data:'    : data,
			'channel:' : (channel + 1)
		};

		if(port === 'K-Mix Audio Control'){
			debugLog = lodash_omit(debugLog, 'control:');
			debugLog['channel:'] = data[7] + 1;
		}

		console.log('Event Debug', debugLog);
	}
	if(kmixLog) kmixLog.innerHTML = controlName + '<br>from ' + port + '<br>portID ' + event.target.id + '<br>' + data + '<br>channel ' + (channel + 1);
}

function stateChangeHandler(event, device) {
  const { name, type, state } = event.port;
  let portName = 'error';

  if(!name.includes(device.deviceName)) return

  if(device._debug === 'state') console.log('>> K-Mix State', event.port);

  const cleanName = camelcase(name.replace('K-Mix ',''));
  
  // ignore HUI
  if(cleanName.includes('Hui')) return
  
  switch (name) {
    case 'K-Mix Audio Control':
      portName = cleanName;

      break;
    case 'K-Mix Control Surface':
      portName = cleanName;

      break;
    case 'K-Mix Expander':
      portName = cleanName;

      break;
    default:
      device.emit('connectionerror');
  }

  device.connections[portName][type] = state === 'connected' ? true : false;

  // connected
  if(Object.values(device.connections).every(port => port.input && port.output)) {
    device.emit('connected');
  }
  // disconnected
  if(Object.values(device.connections).every(port => !port.input && !port.output)) {
    device.emit('disconnected');
  }

}

// vendor

function controlMessageFromOptions(control, value, bank, options){
	let banks = ['bank_1', 'bank_2', 'bank_3'],
			channel = options['midi-channels'][bank - 1],
			cc = options[control][banks[bank - 1]],
			type = 0;

	if(control.includes('fader') || control.includes('rotary')){
		type = 176;
	} else {
		if(value === 0){
			type = 128;
		} else {
			type = 144;
			value = 127;
		}
	}

	type = type + channel - 1;

	if(!type) throw new Error('Check control name')

	let message = [type, cc, value];

	return lodash_without(message, undefined, null);
}

// vendor

function helpObject(obj, message = 'control'){
	return Object.keys(obj).map(function(key){
	  return { [message] : key, CC: obj[key] };
	});
}

function helpRequest(options, request){
	switch(request){
		case 'input':
			console.log('\nhelp:input');
			console.table(helpObject(messages[0], 'control: per-channel 1 - 8'));
			break;
		case 'main':
			console.log('\nhelp:main');
			console.table(helpObject(messages[1], 'control: channel 9 (auto)'));
			break;
		case 'misc':
			console.log('\nhelp:misc');
			console.table(helpObject(messages[2], 'control: channel 10 (auto)'));
			break;
		case 'control':
			console.log('\nhelp:control. What channels are assigned to each control/bank, Editor MIDI tab');
			console.log(lodash_omit(options, 'midi-channels'));
			console.table(lodash_omit(options, 'midi-channels')); // omit type
			break;
	}
}

let names = ['bank_1', 'bank_2', 'bank_3', 'mode'];

class KMIX extends EventEmitter {
	constructor(midi, userOptions = {}, debug = false){
		super();

		this.deviceName = 'K-Mix';
		this._debug = debug;
		// store port connection status
		this.connections = {
			audioControl: {input: false, output: false},
			controlSurface: {input: false, output: false},
			expander: {input: false, output: false}
		};

		// ports
		this.audioControl = {input: null, output: null};
		this.controlSurface = {input: null, output: null};
		this.expander = {input: null, output: null};

		this.midi = midi;
		// set statechange handler
		this.midi.addEventListener('statechange', (e) => stateChangeHandler(e, this));

		this.banks = lodash_initial(names);

		let newOptions = convertOptions(userOptions, names);
		// make options
		this.options = merge(KMIXDefaults, newOptions);

		// store ports and connecitons
		this.midi.inputs.forEach(input => storePortConnections(input, this));
		this.midi.outputs.forEach(output => storePortConnections(output, this));

		if(!this.controlSurface.input) {
			console.error('> K-Mix API: Control Surface Port not connected');
			return
		}

		// set default ports
		this.input = this.controlSurface.input;
		this.output = this.audioControl.output;

		// set listener for messages
		this.input.onmidimessage = (e) => {
			// add formatted console logging
			midiMessageHandler(e, this);
		};
	}

	send(control, value, bank = 1, time = 0) {
		let output, message, sendTime,
			controlType = getControlType(control);

		sendTime = parseInt(time);

		switch(controlType){
			case 'raw':
				// raw : send([176,1,127], time)
				message = control;
				time = value || 0;
				output = this.audioControl.output;

				break;

			case 'raw-control':
				// raw-control : send('control',[176,1,127], time)
				message = value;
				output = this.controlSurface.output;

				break;

			case 'control':
				// to control-surface : send('control:button-vu',0), send('control:fader-1', 64)
				control = control.split(':')[1];
				message = controlMessageFromOptions(control, value, bank, this.options);
				output = this.controlSurface.output;
				
				break;

			case 'raw-expander':
				control = control.split(':')[1];
				message = value;
				output = this.expander.output;
				
				break;

			case 'expander':
				control = control.split(':')[1];
				message = value;
				output = this.expander.output;
				
				break;

			default: // 'input', 'main', 'misc', 'preset'
				// to audio control : send('fader:1', value, time)
				message = controlMessage(control, value, controlType);
				output = this.audioControl.output;
				break;
		}

		if(message.length < 3 && controlType !== 'preset') {
			console.warn('>> K-Mix: Please check control name');
		} else {
			output.send(message,  window.performance.now() + sendTime);
		}
	}

	isConnected = (port = 'all') => {
		switch (port) {
			case 'all':
				return Object.values(this.connections).every(port => port.input && port.output)
			case 'audio-control':
				return Object.values(this.connections.audioControl).every(Boolean)
			case 'control-surface':
				return Object.values(this.connections.controlSurface).every(Boolean)
			case 'expander':
				return Object.values(this.connections.expander).every(Boolean)
			default:
				return false
		}
	}

	help = (request) => {
		helpRequest(this.options, request);
	}
}

export { KMIX as default };
